import React from 'react';
import { useHistory } from 'react-router-dom';

const Home = ({ user }) => {
  const history = useHistory();

  const handleQuizClick = () => {
    history.push('/quiz');
  };

  return (
    <div>
      <h1>Welcome, {user.username}</h1>
      {user.region === 'mumbai' ? (
        <button onClick={handleQuizClick}>Take the Quiz</button>
      ) : (
        <p>Hello, welcome!</p>
      )}
    </div>
  );
};

export default Home;
